import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPhone, faWhatsapp, faInstagram } from '@fortawesome/free-brands-svg-icons';

function About() {
  return (
    <div>
      <h1>About</h1>
      <div>
        <p>Contact Number: <FontAwesomeIcon icon={faPhone} /> +1234567890</p>
        <p>WhatsApp: <FontAwesomeIcon icon={faWhatsapp} /> +1234567890</p>
        <p>Instagram: <FontAwesomeIcon icon={faInstagram} /> @your_instagram_handle</p>
      </div>
    </div>
  );
}

export default About;
